g2:c.PROCEDURE.g2:a.TEXT:
get-class-hierarchy-test(node: class benchmark-node)

    err-obj: class error;
    base, new: text;
    hier: structure;
    i: integer;

begin
    
    hier = call g2-get-class-hierarchy(the symbol gevm-symcure-action-event);
    base = "[hier]";

    for i = 0 to 1000 do
        hier = call g2-get-class-hierarchy(the symbol gevm-symcure-action-event);
        new = "[hier]";
        if base /= new then begin
            call fail(node, "unstable result [base] [new]");
            return;
        end;
    end;

    call pass(node);

end on error(err-obj)

    call fail(node, "an error of class [the class of err-obj]
occurred: [the text of the error-description of err-obj]");

end
